<script>
    Render = function () {
        var json = JSON.parse(document.getElementById("json").value);
        var min = +99999999999;
        var max = -99999999999;
        json.values.forEach(function (value) {

            if (min > value) {
                min = value;
            }

            if (max < value) {
                max = value;
            }
        });

        var svg = d3.select("svg"),
            width = 100,
            height = 100;

        var canvas = document.getElementById("svg");
        canvas.setAttribute("viewBox","0 0 " + json.width + " " + json.height);

        var i0 = d3.interpolateHsvLong(d3.hsv(120, 1, 0.65), d3.hsv(60, 1, 0.90)),
            i1 = d3.interpolateHsvLong(d3.hsv(60, 1, 0.90), d3.hsv(0, 0, 0.95)),
            interpolateTerrain = function (t) { return t < 0.5 ? i0(t * 2) : i1((t - 0.5) * 2); },
            color = d3.scaleSequential(interpolateTerrain).domain([min, max]);
            
            d3.selectAll("svg > *").remove();
        svg.selectAll("path")
            .data(d3.contours()
                .size([json.width, json.height])
                .thresholds(d3.range(min, max, (max - min) / 20))
                (json.values))
            .enter().append("path")
            .attr("d", d3.geoPath(d3.geoIdentity().scale(width / json.width)))
            .attr("fill", function (d) { return color(d.value); });
    }

    Render();
